export default (state, action) => {
	switch (action.type) {
		case 'INIT_SCHEDULE':
      return {shedule: [], textError: '', loadingFlag: false, authorizationFlag: false};

		case 'LOAD_SCHEDULE':
			return {shedule: [], textError: '', loadingFlag: true, authorizationFlag: false};

		case 'LOAD_SCHEDULE_FAILURE':
			return {shedule: [], textError: action.payload, loadingFlag: false, authorizationFlag: false};

		case 'LOAD_SCHEDULE_SUCCESS':
      return {shedule: action.payload, textError: '', loadingFlag: false, authorizationFlag: true};

		default:
      return {shedule: [], textError: '', loadingFlag: false, authorizationFlag: false};
	}
};
